import React from 'react';
import Layout from "../components/Layout";
import "../App.css";
import logo from '../components/logo-white.png';

const Home = () => {
    return (
        <Layout>
            <h1>Welcome to</h1>
            <img src={logo} className={'logo-container'}></img>
        </Layout>
    );
};

export default Home;
